 function fetchEligible(address _visitor) public view returns(uint256[] memory){
     require(balanceOf(_visitor)>0,"sender does not own nft");
     uint256 _tId=tokenOfOwnerByIndex(_visitor, 0); //6
     address _ownr= owner();
     uint256 _promoSupply=balanceOf(_ownr);//6
     bool isOdd = false;
      uint[] memory idList= new uint256[](_promoSupply/2);
      if((_tId+1)%2 != 0) isOdd = true;
    if(isOdd){
         uint256 _cntr=0;
         for(uint256 i=1; i<_promoSupply;i=i+2){
             idList[_cntr]=(tokenOfOwnerByIndex(_ownr, i));
             _cntr++;
        }
      }else{
         uint256 _cntr=0;
         for(uint256 i=0; i<_promoSupply;i=i+2){
             idList[_cntr]=(tokenOfOwnerByIndex(_ownr, i));
             _cntr++;
         }       
    }
     return idList;
 }

//create collection object having ids of nfts in that collection
// create promo object having {eligible collections, earlyaccess collections}
//fetch eligible promos
